import React from "react";
import './css/Card.css'

const Card = (props) => {
    return 
    <div className = "column">
        <img src={props.avatar} alt="Expert" />
        <p>{props.name}</p>
        <p>{props.position}</p>
        <p>{props.description}</p>
    </div>
};

export default Card;
